import {DELETE_TEST, ADD_TEST} from './actionTypes'

export function deleteTest() {
    return {
        type: DELETE_TEST,
    }
}

export function addTest(test) {
    return {
        type: ADD_TEST,
        test
    }
}
  
export function increaseUserScore(test) {
    return {
        type: ADD_TEST,
        test
    }
}
